import base64
import io
import wave

def base64_to_wav(base64_string, output_path):
    # Decode base64 string
    audio_data = base64.b64decode(base64_string)

    # Save the decoded bytes to a WAV file
    with wave.open(output_path, 'wb') as wav_file:
        wav_file.setnchannels(1)  # Mono
        wav_file.setsampwidth(2)  # 2 bytes (16 bits) per sample
        wav_file.setframerate(44100)  # Sample rate (adjust as needed)
        wav_file.writeframes(audio_data)

# Example list of base64-encoded strings
base64_list = [
        "",
        ""
    ]

# Output directory for WAV files
output_directory = "output_wav_files"

# Create the output directory if it doesn't exist
import os
os.makedirs(output_directory, exist_ok=True)

# Convert each base64 string to a WAV file
for i, base64_string in enumerate(base64_list):
    output_path = os.path.join(output_directory, f"output_{i + 1}.wav")
    base64_to_wav(base64_string, output_path)
    print(f"Converted base64 string {i + 1} to {output_path}")
